import React from "react";
import {fbChecklist} from "../data";

function FbCategoryA() {
  return (
    <div className="category-head">
      <h1>FB Checklist Category B</h1>
      {fbChecklist.map((fbChecklistLine) => {
        const {id, category, text} = fbChecklistLine;
        return (
          <article>
            <div>{text}</div>
          </article>
        )
      })}
    </div>
  )
}

export default FbCategoryA;
